css:
@-moz-document domain("axiom.utm.utoronto.ca") {
html {
	color: #eee;
	background: #333;
	background-color: #333;
}

body {
	width: 100%;
	left: 0px;
	margin: 0px;
	margin-left: 0px;
	padding: 0px;
	padding-left: 0px;
	color: #eee;
	background: #333;
	background-color: #333;
}

nav {
	width: 200px;
	color: #eee;
	background: #333;
	background-color: #333;
}

td {
	color: #eee;
	background: #333;
	background-color: #333;
	border: solid 1px #fff;
}

table {
	color: #eee;
	background: #333;
	background-color: #333;
	border: solid 1px #fff;
	box-shadow: none;
}

td strong {
	color: #fff;
}

.content {
	width: 100%;
	left: 200px;
	margin: 0px;
	margin-left: 0px;
	padding: 0px;
	padding-left: 0px;
	color: #eee;
	background: #333;
	background-color: #333;
}
}
